import React, { Component } from 'react';
import { connect } from 'react-redux'

import { Form, Button } from 'semantic-ui-react'

class SessionForm extends Component {
  constructor() {
    super()
    this.state = {
      date:'',
      location: '',
      hours: 0,
      buyin: 0,
      cashout: 0,
      amount: 0.00
    }
  }

  render() {
    return (
      <Form>
        <Form.Group widths='equal'>
        <Form.Field>
          <label>Date</label>
          <input
            type='date'
            placeholder='Date...'
          />
        </Form.Field>
        <Form.Field>
          <label>Location</label>
          <input placeholder='Location...' />
        </Form.Field>
        <Form.Field>
          <label>Hours</label>
          <input placeholder='Hours Played...' />
        </Form.Field>
        <Form.Field>
          <label>Buy In</label>
          <input placeholder='Bought In For...' />
        </Form.Field>
        <Form.Field>
          <label>Cashout</label>
          <input placeholder='Cashed Out For...' />
        </Form.Field>
        </Form.Group>
        <Button type='submit'>Submit</Button>
      </Form>
    )
  }

}

const mapDispatchToProps = dispatch => {
  return {

  }
}

export default connect(null, mapDispatchToProps)(SessionForm);
